INSERT INTO `block_content__body` VALUES ('basic',0,1,1,'en',0,'<p>Interactively transition multidisciplinary niche markets before seamless best practices. Rapidiously recaptiualize synergistic supply chains without client-centric materials. Appropriately optimize transparent experiences and diverse ideas.&nbsp;</p>\r\n','','basic_html'),('basic',0,5,5,'en',0,'<p>Objectively conceptualize high standards in intellectual capital vis-a-vis covalent meta-services. Dramatically synthesize just in time core competencies through interactive intellectual capital. Compellingly impact focused mindshare after fully researched testing procedures. Seamlessly benchmark enabled e-commerce with low-risk high-yield niches.</p>\r\n\r\n<p><a class=\"button\" href=\"#\">Get in touch</a></p>\r\n','','full_html'),('basic',0,7,7,'en',0,'<p>Business+ Lite is the free version of <a href=\"http://www.morethanthemes.com/?q=themes/businessplus&amp;mt-referral=businesslite\" target=\"_blank\">Business+</a>&nbsp;by <a href=\"http://www.morethanthemes.com/&amp;mt-referral=businesslite\" target=\"_blank\"> More than Themes</a>.</p>\r\n','','full_html'),('basic',0,9,9,'en',0,'<p class=\"pb-0\">Business+&nbsp;Lite is a free theme, contributed to the Drupal Community by <a href=\"https://www.morethanthemes.com\" target=\"_blank\">More than Themes</a>.</p>\r\n','','full_html'),('basic',0,15,15,'en',0,'<div class=\"overlay-container\"><img alt=\"sidebar image\" src=\"https://mttprojects.s3.amazonaws.com/demo.drupalizing.com/businessplus-lite/block-img.jpg\" /></div>\r\n\r\n<h3><a href=\"#\">Sidebar block with image</a></h3>\r\n\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do <a href=\"#\">eiusmod tempor</a> incididunt ut labore et dolore magna aliqua.</p>\r\n\r\n<p class=\"more-link\"><a href=\"#\">read more</a></p>\r\n','','full_html'),('basic',0,16,16,'en',0,'<h2 class=\"text-center text--dark mb-5 mt-5\">Let\'s work <span class=\"text--colored\">together</span></h2>\r\n\r\n<di