mething here as well</li>\r\n			<li>Something here as well</li>\r\n		</ul>\r\n		</li>\r\n		<li>Then one more</li>\r\n	</ul>\r\n	</li>\r\n	<li>Nunc cursus sem et pretium sapien eget.</li>\r\n</ul>\r\n\r\n<h3>Fieldset</h3>\r\n\r\n<fieldset><legend>Account information</legend></fieldset>\r\n\r\n<h3>Buttons &amp; Text fields</h3>\r\n\r\n<p><a class=\"button\" href=\"#\">Find out more</a></p>\r\n\r\n<h4>Text Fields</h4>\r\n\r\n<form action=\"#\">\r\n<div class=\"form-item form-type-textfield\"><input class=\"form-text\" name=\"subscribe\" onblur=\"if (this.value == \'\') {this.value = \'Your email address\';}\" onfocus=\"if (this.value == \'Your email address\') {this.value = \'\';}\" type=\"text\" value=\"Your email address\" /></div>\r\n\r\n<div class=\"form-actions\"><input class=\"form-submit\" id=\"edit-submit-3\" name=\"subscribe\" type=\"submit\" value=\"Subscribe\" /></div>\r\n</form>\r\n\r\n<form action=\"#\" class=\"container-inline\">\r\n<div class=\"form-item form-type-textfield\"><input class=\"form-text\" name=\"subscribe\" onblur=\"if (this.value == \'\') {this.value = \'Inline form items\';}\" onfocus=\"if (this.value == \'Your email address\') {this.value = \'\';}\" type=\"text\" value=\"Inline form items\" /></div>\r\n\r\n<div class=\"form-actions\"><input class=\"form-submit\" id=\"edit-submit-4\" name=\"subscribe\" type=\"submit\" value=\"Subscribe\" /></div>\r\n</form>\r\n\r\n<h4>Select Dropdown</h4>\r\n\r\n<p><select class=\"form-select\" name=\"select_field\"><option selected=\"selected\" value=\"All\">- Any -</option><option value=\"6\">Apartment</option><option value=\"7\">Family House</option><option value=\"8\">Office</option></select></p>\r\n\r\n<h3>Table</h3>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<th>Header 1</th>\r\n			<th>Header 2</th>\r\n		</tr>\r\n		<tr class=\"odd\">\r\n			<td>row 1, cell 1</td>\r\n			<td>row 1, cell 2</td>\r\n		</tr>\r\n		<tr class=\"even\">\r\n			<td>row 2, cell 1</td>\r\n			<td>row 2, cell 2</td>\r\n		</tr>\r\n		